import React from 'react';
import { Button, Icon } from 'antd';
import GitHubCalendar from 'react-github-calendar';

function UserCard(props) {


    return (

        <section id="userCard">
            <div>
                <img src={props.img} />
            </div>

            <div>

            <div>
                <h2>{props.login}</h2>
            </div>

            <div>
                <h4>{props.followers} Followers</h4>
            </div>

            <div>
                <h4>{props.following} Following</h4>
            </div>

            <p><Icon type="environment" /> {props.location}</p>
            <div className='container'>
                <GitHubCalendar username="JRodDvlpr"/><Icon type="github" />
            </div>

            </div>
        </section>

    );
}

export default UserCard;
